import {Avatar, Row, Col,  Icon, Statistic, Divider,Layout, Card} from "antd"
import React, {Component,  Fragment} from 'react'

import { Chart,
  Geom,
  Axis,
  Tooltip } from "bizcharts";
const {Content} = Layout
const {Grid, Meta} = Card;
const data = [
  {
    time: "8 am",
    alert: 20
  },
  {
    time: "9 am",
    alert: 27
  },
  {
    time: "10 am",
    alert: 36
  },
  {
    time: "11 am",
    alert: 56
  },
  {
    time: "12 pm",
    alert: 53
  },
  {
    time: "1 pm",
    visitor: 62
  },
  {
    time: "2 pm",
    visitor: 75
  },
  {
    time: "3 pm",
    visitor: 95
  },
  {
    time: "4 pm",
    visitor: 125
  },
  {
    time: "5 pm",
    visitor: 175
  },
];

class MostAlerted extends Component{
  render(){
    return(
      <Content >

      <Statistic title="Visits (Daily)" value="15,102" />
      <div >
        <Chart height={45} padding={0} data={data}  forceFit>
          <Axis name="time" visible={false} />
          <Axis name="visitor" visible={false} />
          <Tooltip
            crosshairs={{ type: "y" }}
          />

          <Geom adjust= {"stack"} type="area" position="time*visitor" color={"#1890ff"} shape="smooth" />
          <Geom
            type="point"
            position="time*visitor"
            size={2}
            shape={"smooth"}
            style={{
              stroke: "#fff",
              lineWidth: 1
            }}
          />
        </Chart>
      </div>
      <Divider/>
      <div>
        <p>Hourly Visits <span>107 views</span></p>
      </div>
    </Content>


    )
  }
}
export default MostAlerted;
